description:
Variation of conditions: 2 (Approved drawings), 15 (secured by design) and 28 (Energy Strategy); and the removal of conditions 7 (Obscured windows), 20 (Noise and vibration limitation) and 34 (No primary cooking) of planning permission ref. 16/06668/FUL (Redevelopment of the site involving demolition of existing building and erection of a building up to 9-storeys in height plus basement level to provide offices (Use Class B1) at lower ground and ground floor, a cafe (Use Class A1) at ground floor and 62 residential units (Use Class C3) at upper floor levels, together with provision of cycle parking, refuse storage and amenity space) granted on 21.06.2017.

Amendments sought: 
-	Re-positioning of office entrance along the building frontage and revision of the front elevation; 
-	Removal of the curved element and the alley-way style entrance to the office;
-	Installation of additional internal stairs serving the office layout;
-	Cluster of 16 office rooflights to be replaced with 2 larger rooflights;
-	Internal reconfiguration associated with service areas and relocation of the substation from lower ground to ground level;
-	Amendments to the market housing mix;
-	Amendments to the location and mix of affordable units;
-	Revision of size and positioning of balconies and roof terraces; and 
-	Replacement of balustrades with safety railings at the roof terrace;
-	Removal of caf to provide additional office space (use class B1);
-	Removal of side windows on the boundaries on the north and south elevation; and
-	Alteration to the massing of the upper floors of the front building and an increase in parapet height by 700mm.
